import axios from "axios";
import "./App.css";
import { useEffect, useState } from "react";



function App() {
    const [users, setUsers] = useState([]);
    useEffect(() => {
        axios.get('https://jsonplaceholder.typicode.com/users')
            .then(res => {
                setUsers(res.data);
            })
            .catch(err => {
                console.log(err);
            })
    });
	return <></>;
}

export default App;
